import React from "react";
import './ExpenseFilter.css';

export function ExpenseFilter() {
    return (
        <div className="expenses-filter">
            <div className="expenses-filter__control">
                <select>
                    <option>2022</option>
                    <option>2021</option>
                    <option>2020</option>
                    <option>2019</option>
                </select>
            </div>
        </div>
    )
}
